import Resource from "./Resource";
import $ from "jquery";

var cpuUsage;
$.ajax({url: "http://localhost:4000/cpuUsage", success: function(result){
  cpuUsage = result;
}});

function ResourceUsageBar() {
    return (

        <div id="resource-usage-bar">
            <Resource 
            imgPath={"#"}
            usageMetric={cpuUsage}
            resourceName={"CPU"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"13%"}
            resourceName={"MEM"}
          />
    
          <Resource 
            imgPath={"#"}
            usageMetric={"20GB"}
            resourceName={"Free"}
          />
        </div>

    );
}

export default ResourceUsageBar;
